		block_codes.SECONDARY_THRESH_NAME = 2310;                           %A name/description of secondary thresholds used in the behavior.

		block_codes.INIT_THRESH_TYPE = 2320;                                %Type of initation threshold (i.e. force or touch), for the specified input.

		block_codes.REMOTE_MANUAL_FEED = 2400;                              %A timestamped manual feed event, triggered remotely.
		block_codes.HWUI_MANUAL_FEED = 2401;                                %A timestamped manual feed event, triggered from the hardware user interface.
		block_codes.FW_RANDOM_FEED = 2402;                                  %A timestamped manual feed event, triggered randomly by the firmware.
		block_codes.SWUI_MANUAL_FEED_DEPRECATED = 2403;                     %A timestamped manual feed event, triggered from a computer software user interface.
		block_codes.FW_OPERANT_FEED = 2404;                                 %A timestamped operant-rewarded feed event, trigged by the OmniHome firmware, with the possibility of multiple feedings.
		block_codes.SWUI_MANUAL_FEED = 2405;                                %A timestamped manual feed event, triggered from a computer software user interface.
		block_codes.SW_RANDOM_FEED = 2406;                                  %A timestamped manual feed event, triggered randomly by computer software.
		block_codes.SW_OPERANT_FEED = 2407;                                 %A timestamped operant-rewarded feed event, trigged by the PC-based behavioral software, with the possibility of multiple feedings.

		block_codes.MOTOTRAK_V3P0_OUTCOME = 2500;                           %MotoTrak version 3.0 trial outcome data.
		block_codes.MOTOTRAK_V3P0_SIGNAL = 2501;                            %MotoTrak version 3.0 trial stream signal.

		block_codes.OUTPUT_TRIGGER_NAME = 2600;                             %Name/description of the output trigger type for the given index.

		block_codes.VIBRATION_TASK_TRIAL_OUTCOME = 2700;                    %Vibration task trial outcome data.

		block_codes.LED_DETECTION_TASK_TRIAL_OUTCOME = 2710;                %LED detection task trial outcome data.
		block_codes.LIGHT_SRC_MODEL = 2711;                                 %Light source model name.
		block_codes.LIGHT_SRC_TYPE = 2712;                                  %Light source type (i.e. LED, LASER, etc).

		block_codes.ST_TACTILE_2AFC_TRIAL_OUTCOME = 2720;                   %SensiTrak tactile discrimination task trial outcome data.

		block_codes.MAX_ANGLE_POSSIBLE = 2800;                              %Maximum possble angle the proprioception module can do.

end


%% ***********************************************************************
function Vulintus_Send_Error_Report(recipient,subject,msg)

%
%Vulintus_Send_Error_Report.m - Vulintus, Inc.
%
%   Vulintus_Send_Error_Report sends an error report ("msg") by email to 
%   the specified recipient ("target") through the Vulintus dummy 
%   error-reporting account.
%
%   The funtion must be compiled for deployment. Compile using the
%   following command in the command line:
%   
%       mcc -e -v Vulintus_Send_Error_Report.m
%   
%   UPDATE LOG:
%   02/21/2017 - Drew Sloan - Added enabling of a STARTTLS command.
%

try                                                                         %Attempt to send an email with the error information.
    setpref('Internet','E_mail','error.report@vulintus.com');               %Set the default email sender to "error.report@vulintus.com".
    setpref('Internet','SMTP_Server','smtp.gmail.com');                     %Set the SMTP server to Gmail.
    setpref('Internet','SMTP_Username','error.report@vulintus.com');        %Set the SMTP username.
    setpref('Internet','SMTP_Password','vulintus');                         %Set the password for the error reporting account.
    props = java.lang.System.getProperties;                                 %Grab the javascript email properties.
    props.setProperty('mail.smtp.auth','true');                             %Set the email properties to enable gmail logins.
    props.setProperty('mail.smtp.starttls.enable','true');                  %Enable the STARTTLS command.
    props.setProperty('mail.smtp.socketFactory.class', ...
                      'javax.getprfenet.ssl.SSLSocketFactory');             %Create an SSL socket.                  
    props.setProperty('mail.smtp.socketFactory.port','465');                %Set the email socket to a secure port.
    sendmail(recipient,subject,msg);                                        %Email the new and old calibration values to the specified users.
catch err                                                                   %Otherwise...
    warning('%s - %s',err.identifier,err.message);                          %Show the error message as a warning.                                                                  
end


%% ***********************************************************************
function path = Vulintus_Set_AppData_Path(program)

%
%Vulintus_Set_AppData_Path.m - Vulintus, Inc.
%
%   This function finds and/or creates the local application data folder
%   for Vulintus functions specified by "program".
%   
%   UPDATE LOG:
%   08/05/2016 - Drew Sloan - Function created to replace within-function
%       calls in multiple programs.
%

local = winqueryreg('HKEY_CURRENT_USER',...
        ['Software\Microsoft\Windows\CurrentVersion\' ...
        'Explorer\Shell Folders'],'Local AppData');                         %Grab the local application data directory.    
path = fullfile(local,'Vulintus','\');                                      %Create the expected directory name for Vulintus data.
if ~exist(path,'dir')                                                       %If the directory doesn't already exist...
    [status, msg, ~] = mkdir(path);                                         %Create the directory.
    if status ~= 1                                                          %If the directory couldn't be created...
        errordlg(sprintf(['Unable to create application data'...
            ' directory\n\n%s\n\nDetails:\n\n%s'],path,msg),...
            'Vulintus Directory Error');                                    %Show an error.
    end
end
path = fullfile(path,program,'\');                                          %Create the expected directory name for MotoTrak data.
if ~exist(path,'dir')                                                       %If the directory doesn't already exist...
    [status, msg, ~] = mkdir(path);                                         %Create the directory.
    if status ~= 1                                                          %If the directory couldn't be created...
        errordlg(sprintf(['Unable to create application data'...
            ' directory\n\n%s\n\nDetails:\n\n%s'],path,msg),...
            [program ' Directory Error']);                                  %Show an error.
    end
end

if strcmpi(program,'mototrak')                                              %If the specified function is MotoTrak.
    oldpath = fullfile(local,'MotoTrak','\');                               %Create the expected name of the previous version appdata directory.
    if exist(oldpath,'dir')                                                 %If the previous version directory exists...
        files = dir(oldpath);                                               %Grab the list of items contained within the previous directory.
        for f = 1:length(files)                                             %Step through each item.
            if ~files(f).isdir                                             	%If the item isn't a directory...
                copyfile([oldpath, files(f).name],path,'f');                %Copy the file to the new directory.
            end
        end
        [status, msg] = rmdir(oldpath,'s');                                 %Delete the previous version appdata directory.
        if status ~= 1                                                      %If the directory couldn't be deleted...
            warning(['Unable to delete application data'...
                ' directory\n\n%s\n\nDetails:\n\n%s'],oldpath,msg);         %Show an warning.
        end
    end
end


%% ***********************************************************************
function Vulintus_Show_Error_Report(program, err)

%
%Vulintus_Show_Error_Report.m - Vulintus, Inc.
%
%   Vulintus_Show_Error_Report creates a pop-up summary of an error report,
%   which is useful when programs are compiled and running without a
%   command line display. The functon blocks execution until the summary is
%   closed.
%   
%   UPDATE LOG:
%   11/19/2019 - Drew Sloan - Function first created, adapted from
%       Vulintus_Send_Error_Report.m.
%

fig = figure('menubar','none',...
    'name',upper([program ' Error Summary']),...
    'numbertitle','off');
ax = axes('units','normalized',...
    'position',[0 0 1 1],...
    'color','w',...
    'xlim',[0,1],...
    'ylim',[0,1],...
    'parent',fig);
t = text(0.05,1,err.identifier,...
    'fontsize',10,...
    'horizontalalignment','left',...
    'verticalalignment','top',...
    'interpreter','none',...
    'parent',ax);
y = get(t,'extent');
t = text(0.05,y(2) - 0.01,['     ' err.message],...
    'fontsize',10,...
    'horizontalalignment','left',...
    'verticalalignment','top',...
    'interpreter','none',...
    'parent',ax);
for i = 1:length(err.stack)
    y = get(t,'extent');
    t = text(0.05,y(2) - 0.01,err.stack(i).name,...
        'fontsize',10,...
        'horizontalalignment','left',...
        'verticalalignment','top',...
        'interpreter','none',...
        'parent',ax);
    y = get(t,'extent');
    t = text(0.05,y(2) - 0.01,['     LINE: ' num2str(err.stack(i).line)],...
        'fontsize',10,...
        'horizontalalignment','left',...
        'verticalalignment','top',...
        'interpreter','none',...
        'parent',ax);
end
set(ax,'xtick',[],'ytick',[]);
uiwait(fig);


%% ***********************************************************************
function StimBehavior_Behavior_Loop(fig)

%
%StimBehavior_Behavior_Loop.m - Vulintus, Inc.
%
%   STIMBEHAVIOR_BEHAVIOR_LOOP is the main behavioral loop for the 
%   StimBehavior task program.
%   
%   UPDATE LOG:
%   01/18/2022 - Drew Sloan - Function first implemented, adapted from
%       ST_Tactile_2AFC_Behavior_Loop.m.
%

global run                                                                  %Create the global run variable.

handles = guidata(fig);                                                     %Grab the handles structure from the main GUI.

%Clear the GUI.
handles = StimBehavior_Update_Controls_Within_Session(handles);             %Disable all of the uicontrols and uimenus during the session.
Clear_Msg([],[],handles.msgbox);                                            %Clear the existing messages out of the messagebox.

%Initialize various session tracking variables.
session = StimBehavior_Initialize_Session(handles);                         %Call the subfunction to initialize the session.
temp = StimBehavior_Load_Previous_Performance(handles);                     %Load this subject's previous performance.   
session.counts(2:end,:) = session.counts(2:end,:) + temp(2:end,:);          %Add the historical counts to the current tracking matrix.        
handles = StimBehavior_Create_Session_Plots(handles, session);              %Initialize the session plots.
trial = struct('start_time',[],'end_time',[],'status_flag',ones(1,4));      %Create a structure to hold trial parameters.
% pause_text = 0;                                                             %Create a variable to hold a text handle for a pause label.
% errstack = zeros(1,3);                                                      %Create a matrix to prevent duplicate error-reporting.

%Create the output data file.
handles.block_codes = Load_OmniTrak_File_Block_Codes(1);                    %Load the OmniTrak file format block code libary.
[session.fid, ~] = StimBehavior_Write_File_Header(handles);                 %Use the Write File Header subfunction to start an OmniTrak vile.

%Set the controller parameters for this session.
handles.moto.clear();                                                       %Clear any residual values from the serial line.  
handles.moto.stream_enable(1);                                              %Enable periodic streaming on the MotoTrak controller.


%% MAIN LOOP ***********************************************************************************************************************
while fix(run) == 2                                                         %Loop until the user ends the session.
    
%WAIT FOR THE SUBJECT TO RELEASE THE CAROUSEL **************************************************************************************
    trial.start_time = [];                                                  %Reset the trial start time to go into idle mode.
    while trial.status_flag(2) && run == 2                                  %Loop until no carousel touch is detected...
        [trial, session] = ...
            StimBehavior_Check_Signal(handles, session, trial);             %Check for any new samples on the serial line.
        pause(0.005);                                                       %Pause for 5 milliseconds.
    end  
    
%PREPARE THE NEXT TRIAL ************************************************************************************************************
    session.trial_num = session.trial_num  + 1;                             %Increment the trial counter.
    trial = StimBehavior_Reset_Trial(handles, session, trial);              %Reset the trial.    
    
%WAITING FOR TRIAL INITIATION ******************************************************************************************************
    while ~trial.status_flag(2) && run == 2                                 %Loop until a carousel touch is detected...
        [trial, session] = ...
            StimBehavior_Check_Signal(handles, session, trial);             %Check for any new samples on the serial line.
        pause(0.005);                                                       %Pause for 5 milliseconds.
    end
    
%START THE TRIAL *******************************************************************************************************************
    if run == 2                                                             %If a manual feed wasn't triggered...        
        trial = StimBehavior_Start_Trial(handles,session,trial);            %Initialize the trial variables.
%         trial = StimBehavior_Create_Trial_Plot(handles, session, trial); %Create a plot showing a trial diagram.        
    end
    
%MONITOR THE TRIAL *****************************************************************************************************************
    while trial.status_flag(1) && now < trial.end_time && run == 2          %Loop until the carousel is released or the end of the trial...
        [trial, session] = ...
            StimBehavior_Check_Signal(handles, session, trial);             %Check for any new samples on the serial line.
        pause(0.005);                                                       %Pause for 5 milliseconds.
    end
    
%RECORD TRIAL RESULTS **************************************************************************************************************
    switch run                                                              %Switch between the recognized run cases.
        
        case 2.0                                                            %If the session is still running as normal...            
            [session, trial] = ...
                StimBehavior_Update_Session(handles, session, trial);       %Calculate the trial outcome and display it.
            StimBehavior_Write_Trial_Data(handles, session, trial);         %Write the trial data to file.       
            
        case 2.2                                                            %If the user wants to manually feed.
            session.feedings = session.feedings + 1;                        %Increment the feedings count.
            Vulintus_Behavior_Manual_Feed(session.fid,...
                handles.block_codes.SWUI_MANUAL_FEED, handles.moto, 1,...
                handles.msgbox, session.feedings);                          %Call the toolbox function to trigger and record a feeding.
            session.trial_num = session.trial_num - 1;                      %Decrement the trial counter.
            run = 2;                                                        %Reset the run variable to 2.0.
            
        case 2.3                                                            %If the user wants to open a webcam preview...    
            Vulintus_Behavior_Launch_Webcam_Preview;                        %Call the toolbox function to launch a webcam preview.
            run = 2;                                                        %Reset the run variable to 2.0.
    end           
    
    drawnow;                                                                %Update the figure and execute any waiting callbacks.
    
end
    
fclose(session.fid);                                                        %Close the session data file.

%Stop the data stream.
try                                                                         %Attempt to clear the serial line.
    handles.moto.stream_enable(0);                                          %Disable streaming on the MotoTrak controller.
    handles.moto.clear();                                                   %Clear any residual values from the serial line.
catch err                                                                   %If an error occurred...
    txt = StimBehavior_Save_Error_Report(handles,err);                      %Save a copy of the error in the AppData folder.
    StimBehavior_Send_Error_Report(handles,handles.err_rcpt,txt);           %Send an error report to the specified recipient.
end

str = sprintf('%s - Session ended, %1.0f total feedings.',...
    datestr(now,13),session.feedings);                                      %Create a session ending message.
Replace_Msg(handles.msgbox,str);                                            %Show the user that the session has ended.

Vulintus_All_Uicontrols_Enable(handles.mainfig,'off');                      %Disable all of the uicontrols.

guidata(handles.mainfig,handles);                                           %Pin the handles structure to the main figure.


%% ***********************************************************************
function [trial, session] = StimBehavior_Check_Signal(handles, session, trial)

%
%StimBehavior_Check_Signal.m - Vulintus, Inc.
%
%   StimBehavior_CHECK_SIGNAL checks the OmniTrak controller for new 
%   streaming data from the nosepoke and pellet reciever and adds any new 
%   data it finds to the trial initiation monitored signal.
%   
%   UPDATE LOG:
%   01/18/2022 - Drew Sloan - Function first implemented, adapted from
%       ST_Tactile_2AFC_Check_Signal.m
%

new_data = handles.moto.read_stream();                                      %Read in any new stream output.
N = size(new_data,1);                                                       %Find the number of new samples.

if ~N                                                                       %If there's no new data...
    return                                                                  %Skip the rest of the function.
end

new_data(:,2) = handles.slope*(new_data(:,2) - handles.baseline);           %Apply the calibration constants to the primary data signal.
session.buffer(1:end-N,:) = session.buffer(N+1:end,:);                      %Shift the existing force buffer samples to make room for the new samples.
session.buffer(end-N+1:end,:) = new_data(:,1:2);                            %Add the new samples to the buffer.

trial.status_flag(2) = any(session.buffer(session.debounce_index,2) > ...
    handles.force_thresh);                                                  %Check for any force samples exceeding the threshold.
trial.status_flag(3:4) = any(new_data(:,3:4) > handles.ir_thresh,1);        %Check for any nosepoke events.
    
StimBehavior_Update_Sensor_Diagrams(handles,trial.status_flag(2:4));        %Update the sensor diagrams.

% if isempty(trial.start_time)                                                %If there's no active trial..        
%     StimBehavior_Update_Force_Plot(handles,session.buffer(:,2));            %Update the force plot with the session buffer.    
%     drawnow;                                                                %Update the figure and execute any waiting callbacks.
%     return                                                                  %Skip the rest of the function.
% end

trial.signal(trial.signal_index + (1:N),:) = new_data(:,1:2);               %Copy the new data to the trial force signal.
trial.signal_index = trial.signal_index + N;                                %Increment the trial signal index.
StimBehavior_Update_Force_Plot(handles,trial.signal(:,2));                  %Update the force plot with the current trial signal.

if isempty(trial.touch_time) && (~trial.status_flag(2))                     %If the carousel was released for the first time...
    i = find(trial.signal(:,2) > handles.force_thresh,1,'last');            %Find the last supra-threshold sample...
    trial.touch_time = (trial.signal(i,1) - trial.start_millis)/1000000;    %Grab the time the rat held.
    if trial.touch_time > handles.max_touch_dur                             %If the subject never let go of the carousel...        
        trial.outcome = 'L';                                                %Set the outcome to "L" for loitering.
        trial.status_flag(1) = 0;                                           %Set the status flag to zero.
    elseif strcmpi(handles.reward_mode,'hold')                              %If this is a hold reward paradigm...        
        if trial.touch_time >= trial.hold_time                              %If the subject held through the hold time...
            handles.moto.feed();                                            %Trigger a feeding.
            trial.feed_time(end+1) = now;                                   %Save the feeding time.
            session.feedings = session.feedings + 1;                        %Increment the feed count.
        else                                                                %Otherwise...
            trial.status_flag(1) = 0;                                       %Set the status flag to zero.
            trial.outcome = 'A';                                            %Set the outcome to "A" for abort.
        end        
    end
    handles.moto.stop_tone();                                               %Stop any press tone.
elseif ~strcmpi(handles.reward_mode,'hold') && ...
        ~isempty(trial.touch_time) && (trial.status_flag(2))                %If the carousel was re-engaged and this isn't a hold training session...
    trial.touch_time = [];                                                  %Reset the touch time tracker.
end

if any(trial.status_flag(3:4))                                              %If any of the pellet receivers are blocked...
    feeder_chars = 'LR';                                                    %Set the characters for the feeders.
    [i,j] = find(new_data(:,3:4) > handles.ir_thresh);                      %Find the first blocked sample.
    trial.response_time = (new_data(i(1),1) - trial.start_millis)/1000000;  %Grab the response time.    
    trial.visited_feeder = feeder_chars(j(1));                              %Save the visited feeder label.
    trial.status_flag(1) = 0;                                               %Set the status flag to zero.
end
drawnow;                                                                    %Update the figure and execute any waiting callbacks.


%% ***********************************************************************
function handles = StimBehavior_Create_Sensor_Diagrams(handles)

%
%StimBehavior_Create_Sensor_Diagrams.m - Vulintus, Inc.
%
%   STIMBEHAVIOR_CREATE_SENSOR_DIAGRAMS creates displays to show the 
%   status of interaction sensors on the nosepoke and pellet receivers in
%   the StimBehavior task.
%   
%   UPDATE LOG:
%   11/30/2021 - Drew Sloan - Function first created, adapted from ST_Tactile_2AFC_Create_Sensor_Diagrams
%

cla(handles.sensor_ax);                                                     %Clear the sensor axes.
hold(handles.sensor_ax,'on');                                               %Hold the axes for multiple plots.
c_r = 1.0;                                                                  %Set the carousel diagram radius.
x = c_r*sind(0:3:360);                                                      %Create x-coordinates.
y = c_r*cosd(0:3:360);                                                      %Create y-coordinates.
handles.diagram.carousel.disc = fill(x,y,[0.75 0.75 0.75],...
    'edgecolor','k',...
    'linewidth',2,...
    'parent',handles.sensor_ax);                                            %Create a fill object.
handles.diagram.carousel.pads = zeros(numel(handles.disc.position),1);      %Create a matrix to hold fill object handles.
handles.diagram.carousel.labels = zeros(numel(handles.disc.position),1);    %Create a matrix to hold text object handles.
p_d = 0.16*c_r;                                                             %Set the dimensions of the pad diagram.
p_r = 0.75*c_r;                                                             %Set the radius of the pad diagrams.
xy = p_d*[1 1; 1 -1; -1 -1; -1 1];                                          %Create coordinates for a square.
xy(:,2) = xy(:,2) - p_r;                                                    %Shift the y-coordinates downward.
a = 360/numel(handles.disc.position);                                       %Calcule the step angle.
for i = 1:numel(handles.disc.position)                                      %Step through each disc position.
    theta = -a*(i-1);                                                       %Calculate the angle for this pad.
    R = [cosd(theta) -sind(theta); sind(theta) cosd(theta)];                %Create a rotation matrix.
    r_xy = xy*R';                                                           %Rotate the coordinates.
    handles.diagram.carousel.pads(i) = ...
        fill(r_xy(:,1),r_xy(:,2),[0.9 0.9 0.9],...
        'edgecolor','k',...
        'linewidth',1,...
        'parent',handles.sensor_ax);                                        %Create a fill object for each pad.
    handles.diagram.carousel.pads(i) = ...
        text(p_r*cosd(-90 + theta),p_r*sind(-90 + theta),...        
        handles.disc.position(i).label,...
        'rotation',theta,...
        'fontsize',30*p_d,...
        'fontweight','bold',...
        'fontname','Arial',...
        'verticalalignment','middle',...
        'horizontalalignment','center',...
        'parent',handles.sensor_ax);                                        %Create a text label for the right receiver.
end

pr_r = 0.5*c_r;                                                             %Set the half-height and half-width of the pellet receiver diagram.
xy = [(0.5*pr_r*sind(0:3:90) + 0.5*pr_r)',...
    (0.5*pr_r*cosd(0:3:90) + 0.5*pr_r)'];                                   %Create x- and y-coordinates for a 90-degree arc.
R = [cosd(-90) -sind(-90); sind(-90) cosd(-90)];                            %Create a rotation matrix.
xy = [xy; xy*R'; (xy*R')*R'; ((xy*R')*R')*R'];                              %Rotate the coordinates to create a filleted box.
offset = 1.1*(c_r + pr_r);                                                  %Set the offset.
handles.diagram.pellet_receiver = zeros(1,2);                               %Create a matrix to hold diagram handles for the pellet receivers.
handles.diagram.pellet_receiver(1) = ...
    fill(xy(:,1)-offset,xy(:,2),[0.75 0.75 0.75],...
    'edgecolor','k',...
    'linewidth',2,...
    'parent',handles.sensor_ax);                                            %Create a fill object for the left receiver.
handles.diagram.pellet_receiver(2) = ...
    fill(xy(:,1)+offset,xy(:,2),[0.75 0.75 0.75],...
    'edgecolor','k',...
    'linewidth',2,...
    'parent',handles.sensor_ax);                                            %Create a fill object for the right receiver.
text(-offset,0,'LEFT',...
    'fontsize',20*pr_r,...
    'fontweight','bold',...
    'fontname','Arial',...
    'verticalalignment','middle',...
    'horizontalalignment','center',...
    'parent',handles.sensor_ax);                                            %Create a text label for the left receiver.
text(offset,0,'RIGHT',...
    'fontsize',20*pr_r,...
    'fontweight','bold',...
    'fontname','Arial',...
    'verticalalignment','middle',...
    'horizontalalignment','center',...
    'parent',handles.sensor_ax);                                            %Create a text label for the right receiver.

handles.sensor_ax.XTick = [];                                               %Hide any x-ticks on the axes.
handles.sensor_ax.YTick = [];                                               %Hide any y-ticks on the axes.
handles.sensor_ax.XLim = (offset + 1.1*pr_r)*[-1,1];                        %Set the x-axis limits.
pos = handles.sensor_ax.Position;                                           %Grab the axes position.
handles.sensor_ax.YLim = (pos(4)/pos(3))*(offset + 1.1*pr_r)*[-1,1];        %Set the y-axis limits to get a 1:1 aspect ration.
handles.sensor_ax.Visible = 'off';                                          %Make the axes invisible.

disableDefaultInteractivity(handles.sensor_ax);                             %Disable the axes interactivity.
handles.sensor_ax.Toolbar.Visible = 'off';                                  %Hide the axes toolbar.


%% ***********************************************************************
function handles = StimBehavior_Create_Session_Plots(handles, session)

%
%StimBehavior_Create_Session_Plots.m - Vulintus, Inc.
%
%   STIMBEHAVIOR_CREATE_SESSION_PLOTS initializes all of the GUI plots
%   at the start of a StimBehavior task behavioral session.
%   
%   UPDATE LOG:
%   01/18/2022 - Drew Sloan - Function first implemented, adapted from
%       ST_Tactile_2AFC_Create_Session_Plots.m.
%

if ~all(ishandle([handles.diagram.carousel.disc,...
        handles.diagram.pellet_receiver]))                                  %If the disc and pellet receivers diagrams aren't initialized.
    handles = StimBehavior_Create_Sensor_Diagrams(handles);                 %Call the function to create them.
end
if ~ishandle(handles.force_plot)                                            %If the force plot isn't yet initialized...
    handles = StimBehavior_Create_Force_Plot(handles);                      %Call the function to create it.
end
if ~isfield(handles,'psych_plots') || ...
        ~all(ishandle(handles.psych_plots.bar.h(:))) || ....
        ~all(ishandle(handles.psych_plots.hist.h(:)))                       %If the psychometric plots aren't initiliazed...
    handles.psych_plots = ...
        StimBehavior_Initialize_Psychometric_Plot(handles);                 %Create the psychometric plots.
end
StimBehavior_Update_Psychometric_Plot(handles.psych_plots,...
    session.counts,[]);                                                     %Update the psychometric plots with the current and historical performance. 


%% ***********************************************************************
function stim_block = StimBehavior_Create_Stimulus_Block(handles)

%
%StimBehavior_Create_Stimulus_Block.m - Vulintus, Inc.
%
%   STIMBEHAVIOR_CREATE_STIMULUS_BLOCK creates a new randomized block of 
%    stimuli for testing in the StimBehavior task.
%   
%   UPDATE LOG:
%   01/18/2022 - Drew Sloan - Function first implemented, adapted from
%       ST_Tactile_2AFC_Create_Stimulus_Block.m.
%



i = vertcat(handles.l_stim_i,handles.r_stim_i,handles.c_stim_i);            %Concatenate all of the active stimulus indices.
stim_block = [i, 'R'*ones(size(i))];                                        %Create a stimulus block with two columns (stimulus index and target feeder).
for i = 1:size(stim_block,1)                                                %Step through each row of the stimulus block.
    if any(stim_block(i,1) == handles.l_stim_i)                             %If the stimulus is a left-hand stimulus...
        stim_block(i,2) = 'L';                                              %Mark it with as a left-feeder stimulus.
    elseif any(stim_block(i,1) == handles.c_stim_i)                         %If the stimulus is a catch stimulus...
        stim_block(i,2) = 'C';                                              %Mark it as a catch trial..
    end
end
i = randperm(size(stim_block,1));                                           %Create random indices for the block.
stim_block = stim_block(i,:);                                               %Randomize the stimulus block.


