function [session, trial] = StimBehavior_Update_Session(handles, session, trial)

%
%StimBehavior_Update_Session.m - Vulintus, Inc.
%
%   This function adds the results of the most recent trial to the session 
%   data and updates the performance plots for the StimBehavior task.
%   
%   UPDATE LOG:
%   01/18/2022 - Drew Sloan - Function first implemented, adapted from
%       ST_Tactile_2AFC_Update_Session.m.
%


if ~isempty(trial.response_time) && ...
        (trial.response_time <= handles.choice_win)                         %If the subject responded within the choice window...
    
    switch trial.target_feeder                                              %Switch between the two target feeders.
        case 'L'                                                            %If the left feeder was the target.
            if trial.visited_feeder == 'L'                                  %If the left feeder was visited...
                trial.outcome = 'C';                                        %Set the outcome to "C" for a correct rejection.
            else                                                            %Otherwise, if the right feeder was visited...
                trial.outcome = 'F';                                        %Set the outcome to "F" for a false alarm.
            end
        case 'R'                                                            %If the right feeder was the target.
            if trial.visited_feeder == 'L'                                  %If the left feeder was visited...
                trial.outcome = 'M';                                        %Set the outcome to "CM" for a miss.
            else                                                            %Otherwise, if the right feeder was visited...
                trial.outcome = 'H';                                        %Set the outcome to "H" for a false alarm.
            end
    end
                
    switch handles.reward_mode                                              %Switch between the reward modes.
        case 'association'                                                  %If we're doing association mode...
            handles.moto.feed();                                            %Trigger a feeding for any response, but to the correct feeder.
            trial.feed_time(end+1) = now;                                   %Save the feeding time.
            session.feedings = session.feedings + 1;                        %Increment the feed count.     
        case 'operant'                                                      %If we're doing operant mode...
            if any(trial.outcome == 'HC')                                   %If the outcome was either a hit or a correct rejection...
                handles.moto.feed();                                        %Trigger a feeding for any response, but to the correct feeder.
                trial.feed_time(end+1) = now;                               %Save the feeding time.
                session.feedings = session.feedings + 1;                    %Increment the feed count.     
            end
    end
end

%Save the trial information in the session-tracking structure.
if trial.visited_feeder ~= 'N'                                              %If a feeder was visited...
    i = (session.counts(1,:) == trial.pad_index);                           %Find the column for this stimulus index.
    session.counts([2,4],i) = session.counts([2,4],i) + 1;                  %Increment the total trial count for this stimulus.
    session.counts([3,5],i) = session.counts([3,5],i) + ...
        (trial.visited_feeder == 'R');                                      %Increment the total trial count for this stimulus.
end
if ~isempty(trial.touch_time)                                               %If there's a touch duration for this trial.
    session.touch_times(end+1) = trial.touch_time;                          %Save the value in the session tracking structure.
end

%Print a message to the messagebox.
switch trial.outcome                                                        %Switch between the different trial outcome abbreviations.
    case 'A'                                                                %"A"
        outcome = 'ABORT';                                                  %Abort.
    case 'L'                                                                %"L"
        outcome = 'LOITER-NONRELEASE';                                      %Loiter, nonrelease.
    case 'N'                                                                %"N"
        outcome = 'RELEASE-NONRESPONSE';                                    %Release, nonresponse.
    case 'H'                                                                %"H"
        outcome = 'HIT';                                                    %Hit.
    case 'M'                                                                %"M"
        outcome = 'MISS';                                                   %Miss.
    case 'F'                                                                %"F"
        outcome = 'FALSE ALARM';                                            %False alarm.
    case 'C'                                                                %"C"
        outcome = 'CORRECT REJECTION';                                      %Correct rejection.
end        
str = sprintf('%s - Trial #%1.0f, %s, (%s)',datestr(trial.start_time,13),...
    session.trial_num,trial.pad_label,outcome);                             %Start a message for the messagbox.
if ~isempty(trial.touch_time)                                               %If the subject released the carousel...
    str = horzcat(str,sprintf(', TT = %1.2f s',trial.touch_time));          %Add the touch time to the message.
end
if ~isempty(trial.response_time)                                            %If the subject visited a feeder...
    str = horzcat(str,sprintf(', RT = %1.2f s',trial.response_time));       %Add the response time to the message.
end
str = horzcat(str,sprintf(', %1.0f feedings',session.feedings));            %Add the total feed count to the message
Replace_Msg(handles.msgbox,str);                                            %Show the text string on the messagebox.

%Increment to the next stimulus in the stimulus block.
if ~strcmpi(handles.reward_mode,'hold') && ...
        trial.target_feeder ~= 'N' && any(trial.outcome == 'ALN')           %If we're not doing hold training and no feeder was chosen...
    session.stim_block(end+1,:) = session.stim_block(session.stim_index,:); %Move the current trial parameters to the end of the stimulus block.
    session.stim_block(session.stim_index,:) = [];                          %Clear the current line of the stimulus block.
else                                                                        %Otherwise...
    session.stim_index = session.stim_index + 1;                            %Increment the stimulus index.
    if session.stim_index > size(session.stim_block,1)                      %If there's no more parameters in the stimulus block...
        session.stim_block = ...
            StimBehavior_Create_Stimulus_Block(handles);                    %Create a new stimulus block.
        session.stim_index = 1;                                             %Set the stimulus index to 1.
    end
end

data = handles.trialtable.Data;                                             %Grab the data from the trial table.
if isempty(data)                                                            %If this is the first data being written to the table...
    data = cell(1,8);                                                       %Create a cell array with 8 columns.
    i = 1;                                                                  %Set the row index to 1.
else                                                                        %Otherwise...
    i = size(data,1) + 1;                                                   %Find the next row index.
end
data{i,1} = sprintf('%1.0f',session.trial_num);                             %List the trial number.
data{i,2} = datestr(trial.start_time,13);                                   %List the start time.
data{i,3} = trial.pad_label;                                                %List the pad label.
data{i,4} = trial.outcome;                                                  %List the outcome.
data{i,5} = char(trial.target_feeder);                                      %List the target_feeder.
data{i,7} = sprintf('%1.3f',trial.hold_time);                               %List the hold time.
if trial.visited_feeder ~= 'N'                                              %If a feeder was visited...
    data{i,6} = trial.visited_feeder;                                       %Show the visited feeder.
    data{i,9} = sprintf('%1.3f',trial.response_time);                       %Show the response time.
else                                                                        %Otherwise...
    data(i,[6,9]) = {'-'};                                                  %Put a placeholder in those cells.
end
if ~isempty(trial.touch_time)                                               %If there's a valid touch time...
    data{i,8} = sprintf('%1.3f',trial.touch_time);                          %Show the touch time.
else                                                                        %Otherwise...
    data{i,8} = '-';                                                        %Put a placeholder in that cell.
end
handles.trialtable.Data = data;                                             %Push the data back to the trial table.
o = (trial.outcome == handles.table_style.outcomes);                        %Find the style index for this outcome.
addStyle(handles.trialtable,handles.table_style.h(o),'cell',[i,4]);         %Add the appropriate style to the outcome cell.
scroll(handles.trialtable,'bottom');                                        %Scroll to the bottom of the table.


%% ***********************************************************************
function [fid,filename] = StimBehavior_Write_File_Header(handles)

%   STIMBEHAVIOR_WRITE_FILE_HEADER writes the file header for StimBehavior
%   task session data files using Vulintus' *.OmniTrak format.
%   
%   UPDATE LOG:
%   01/18/2022 - Drew Sloan - Function first created, adapted from
%       ST_Tactile_2AFC_Write_File_Header.m.
%

if ~exist(handles.datapath,'dir')                                           %If the main data folder doesn't already exist...
    mkdir(handles.datapath);                                                %Create the main data folder on the C:\ drive.
end
path = fullfile(handles.datapath,handles.subject);                          %Create the subfolder name for this rat.
if ~exist(path,'dir')                                                       %If the subject subfolder doesn't already exist...
    mkdir(path);                                                            %Create the subject subfolder.
end
date_string = datestr(now,30);                                              %Create a timestamp string.
temp = handles.stage(handles.cur_stage).number;                             %Grab the stage number.
if ~ischar(temp)                                                            %If the stage number isn't already a string...
    temp = num2str(temp);                                                   %Convert the stage number to a string.
end
temp(temp == '.') = 'p';                                                    %Replace any periods in the stage name with a "p".
temp = ['Stage' temp];                                                      %Add the word "Stage" to the stage string.
filename = [handles.subject '_' date_string '_TACTILE_' temp '.OmniTrak'];  %Create the new filename.
Add_Msg(handles.msgbox,[datestr(now,13) ' - Writing session data to '...
    'file:']);                                                              %Print a message showing the user that the filename will follow.
Add_Msg(handles.msgbox,['          ' path]);                                %Show the user the session data path.
Add_Msg(handles.msgbox,['          ' filename]);                            %Show the user the session data file name.
filename = fullfile(path,filename);                                         %Add the path to the filename.
[fid,errmsg] = fopen(filename,'w');                                         %Open the data file as a binary file for writing.
if fid == -1                                                                %If the file could not be created...
    errordlg(sprintf(['Could not create the session data file '...
        'at:\n\n%s\n\nError:\n\n%s'],filename,...
        errmsg),'Tactile Discrimination Task File Write Error');            %Show an error dialog box.
end

ofbc = handles.block_codes;                                                 %Copy the block codes to an easier-to-handle structure.

%File format verification and version.
fwrite(fid,ofbc.OMNITRAK_FILE_VERIFY,'uint16');                             %The first block of the file should equal 0xABCD to indicate a Vulintus *.OmniTrak file.
fwrite(fid,ofbc.FILE_VERSION,'uint16');                                     %The second block of the file should be the file version indicator.
fwrite(fid,ofbc.CUR_DEF_VERSION,'uint16');                                  %Write the current file version.

%System information.
fwrite(fid,ofbc.SYSTEM_TYPE,'uint16');                                      %Write the block indicating the Vulintus system type.
fwrite(fid,5,'uint8');                                                      %Write a value of 5 to indicate the base system is SensiTrak.
fwrite(fid,ofbc.COMPUTER_NAME,'uint16');                                    %Write the block indicating the computer name.
fwrite(fid,length(handles.host),'uint8');                                   %Write the number of characters in the computer name.
fwrite(fid,handles.host,'uchar');                                           %Write the characters of the computer name.
temp = handles.booth;                                                       %Grab the booth name.
if ~ischar(temp)                                                            %If the booth name isn't already a string...
    temp = num2str(temp);                                                   %Convert the booth name to a string.
end
fwrite(fid,ofbc.USER_SYSTEM_NAME,'uint16');                                 %Write the user system name (i.e. booth number) block code.
fwrite(fid,length(temp),'uint8');                                           %Write the number of characters in the booth name.
fwrite(fid,temp,'uchar');                                                   %Write the characters of the booth name.
fwrite(fid,ofbc.COM_PORT,'uint16');                                         %Write the COM port block code.
fwrite(fid,length(handles.moto.port),'uint8');                              %Write the number of characters in the COM port name.
fwrite(fid,handles.moto.port,'uchar');                                      %Write the characters of the COM port name.
fwrite(fid,ofbc.TIME_ZONE_OFFSET,'uint16');                                 %Write the time zone offset block code.
dt = datenum(datetime('now','TimeZone','local')) - ...
    datenum(datetime('now','TimeZone','UTC'));                              %Calculate the different between the computer time and UTC time.
fwrite(fid,dt,'float64');                                                   %Write the time zone offset as a serial date number.


%Session information.
fwrite(fid,ofbc.CLOCK_FILE_START,'uint16');                                 %Write the file start serial date number block code.
fwrite(fid,now,'float64');                                                  %Write the current serial date number.
fwrite(fid,ofbc.EXP_NAME,'uint16');                                         %Write the experiment name block code.
fwrite(fid,length('Tactile Discrimination Task'),'uint16');                 %Write the number of characters in the experiment name.
fwrite(fid,'Tactile Discrimination Task','uchar');                          %Write the characters of the experiment name.
fwrite(fid,ofbc.SUBJECT_NAME,'uint16');                                     %Write the subject name block code.
fwrite(fid,length(handles.subject),'uint16');                               %Write the number of characters in the subject name.
fwrite(fid,handles.subject,'uchar');                                        %Write the characters of the subject name.
temp = handles.stage(handles.cur_stage).number;                             %Grab the stage number.
if ~ischar(temp)                                                            %If the stage number isn't already a string...
    temp = num2str(temp);                                                   %Convert the stage number to a string.
end
fwrite(fid,ofbc.STAGE_NAME,'uint16');                                       %Write the stage name block code.
fwrite(fid,length(temp),'uint16');                                          %Write the number of characters in the stage name.
fwrite(fid,temp,'uchar');                                                   %Write the characters of the stage name.
fwrite(fid,ofbc.STAGE_DESCRIPTION,'uint16');                                %Write the stage description block code.
fwrite(fid,length(handles.stage(handles.cur_stage).description),'uint16');  %Write the number of characters in the stage description.
fwrite(fid,handles.stage(handles.cur_stage).description,'uchar');           %Write the characters of the stage description.


%% ***********************************************************************
function StimBehavior_Write_Trial_Data(handles, session, trial)

%
%StimBehavior_Write_Trial_Data.m - Vulintus, Inc.
%
%   This function writes the results of the most recent StimBehavior task 
%   trial to the *.OmniTrak data file.
%   
%   UPDATE LOG:
%   01/18/2021 - Drew Sloan - Function first implemented, adapted from
%       ST_Tactile_2AFC_Write_Trial_Data.m.
%

%Write the trial outcome to file.
fwrite(session.fid,...
    handles.block_codes.STIMBEHAVIOR_TRIAL_OUTCOME, 'uint16');              %Write the tactile discrimination task outcome block code to the file.
fwrite(session.fid,session.trial_num,'uint16');                             %Write the trial number.
fwrite(session.fid,trial.start_time,'float64');                             %Write the start time of the trial.
fwrite(session.fid,trial.start_millis,'uint32');                            %Write the start time of the trial as recorded on the millisecond clock.
fwrite(session.fid,trial.outcome(1),'uchar');                               %Write the trial outcome as an unsigned character.
fwrite(session.fid,trial.visited_feeder(1),'uchar');                        %Write the visited feeder unsigned character.
fwrite(session.fid,numel(trial.feed_time),'uint8');                         %Write the number of feedings.
if ~isempty(trial.feed_time)                                                %If there were any feedings...
    fwrite(session.fid,trial.feed_time,'float64');                          %Write the serial date number timestamp for every feeding.
end
fwrite(session.fid,handles.max_touch_dur,'float32');                        %Write the maximum touch duration, in seconds.
for f = {'hold_time',...
        'touch_time',...
        'choice_time',...
        'response_time'}                                                    %Step through various fields of the trial structure.
    if isempty(trial.(f{1}))                                                %If the value is empty...
        fwrite(session.fid,NaN,'float32');                                  %Write a NaN as a 32-bit float.
    else                                                                    %Otherwise...
        fwrite(session.fid,trial.(f{1}),'float32');                         %Write each field value as a 32-bit float.
    end
end
fwrite(session.fid,trial.pad_index,'uint8');                                %Write the pad index.
fwrite(session.fid,length(trial.pad_label),'uint8');                        %Write the number of characters in the pad label.
fwrite(session.fid,trial.pad_label,'uchar');                                %Write pad label as unsigned characters.
fwrite(session.fid,1,'uint8');                                              %Number of data streams (besides the timestamp).
fwrite(session.fid,trial.signal_index,'uint32');                            %Write the number of samples in the buffer.
fwrite(session.fid,trial.signal(1:trial.signal_index,1),'uint32');          %Write the microsecond clock timestamps.
fwrite(session.fid,trial.signal(1:trial.signal_index,2),'float32');         %Write the force sensor values.


